import { Route, Routes } from "react-router";
import { BrowserRouter } from "react-router-dom";
import AdminLogin from "./View/Page/Admin/AdminLogin";
import EmployeLogin from "./View/Page/Employe/EmployeLogin";
import DemandeAchat from "./View/Page/Employe/DemandeAchat";
import HomeApprovisionnement from "./View/Page/Admin/HomeApprovisionnement";
import ValidationDemandeAchat from "./View/Page/Admin/ValidationDemandeAchat";
import CreateProforma from "./View/Page/Admin/CreateProforma";
import BonCommande from "./View/Page/Admin/BonCommande";
import Menu from "./View/Page/Menu";
import "./App.css";
import Home from "./View/Page/Employe/Home";
import ProformaForm from "./View/Page/proforma/Proforma";
import ListDemandeProforma from "./View/Page/proforma/Demande_proforma";
import ListDemandeProformaBDC from "./View/Page/bon_commande/Demande_proforma";
import ListBondeCommande from "./View/Page/bon_commande/ListBondeCommande";
import ListDemandeProformatClient from "./View/Page/Admin/ListDemandeProformatClient";

// import ListDemandeProforma from "./View/Page/proforma/Demande_proforma";

import Envoye_demande from "./View/Page/demandeProforma/envoye_demande";
import EmailInterface from "./View/Page/Admin/EmailInterface";

// FOURNISSEUR RELATED IMPORT
import ProformatHavingBcmd from "./View/Page/Fournisseur/page/ProformatHavingBcmd";
import ProformatDetailsBcmd from "./View/Page/Fournisseur/page/ProformatDetailsBcmd";
import PFBonLivraison from "./View/Page/Fournisseur/page/PFBonLivraison";
import PFDBonLivraison from "./View/Page/Fournisseur/page/PFDBonLivraison";
import Facture from "./View/Page/Fournisseur/page/Facture";
import HistoriqueStock from "./View/Page/Fournisseur/page/HistoriqueStock";
import BonCommandeFournisseur from "./View/Page/bon_commande/BonCommandeFournisseur";

import Vente from "./View/Page/Vente/Vente";
import CreateProform from "./View/Page/Vente/DemandeProforma";
import ListDemandeProformaBcd from "./View/Page/proforma/Demande_proforma_bcd";
import BonReception from "./View/Page/Admin/BonReception";
import Analyse from "./View/Page/Admin/Analyse_Achat";
import Accueil from "./View/Page/Fournisseur/page/Accueil";
import AllProformas from "./View/Page/bon_commande/AllProformas";
import PfToFacture from "./View/Page/Fournisseur/page/PfToFacture";
// PLAYFIELD RELATED URL
// import Give from "./View/Page/Playfield/Give";
// import Take from "./View/Page/Playfield/Take";
// import CheckBoxes from "./View/Page/Playfield/CheckBoxex";

function App() {
  return (
    <div
      id="main-wrapper"
      data-theme="light"
      data-layout="vertical"
      data-navbarbg="skin6"
      data-sidebartype="full"
      data-sidebar-position="fixed"
      data-header-position="fixed"
      data-boxed-layout="full"
    >
      <BrowserRouter>
        <Routes>
          <Route path="/menu" element={<Menu />} />
          <Route path="/loginadmin" element={<AdminLogin />}></Route>
          <Route path="/loginemploye" element={<EmployeLogin />}></Route>
          <Route path="proforma/:iddemande" element={<ProformaForm />}></Route>
          <Route path="/proforma" element={<ProformaForm />}></Route>
          <Route
            path="/listdemandeproforma"
            element={<ListDemandeProforma />}
          ></Route>
          <Route
            path="/listdemandeproformabdc"
            element={<ListDemandeProformaBDC />}
          ></Route>
          <Route
            path="bondecommande/:iddemande"
            element={<ListBondeCommande />}
          ></Route>
          <Route path="/homeEmploye" element={<Home />}></Route>
          <Route path="/demandeAchat" element={<DemandeAchat />}></Route>
          <Route
            path="/listDemandeProformatBcd"
            element={<ListDemandeProformaBcd />}
          ></Route>
          <Route
            path="/listDemandeProformatClient/:iddemande"
            element={<ListDemandeProformatClient />}
          ></Route>
          <Route
            path="/homeApprovisionnement"
            element={<HomeApprovisionnement />}
          ></Route>
          <Route
            path="/validationDemandeAchat"
            element={<ValidationDemandeAchat />}
          ></Route>
          <Route path="/createProforma" element={<CreateProforma />}></Route>
          <Route
            path="/bonCommande/:idDemandeProformat"
            element={<BonCommande />}
          ></Route>
          <Route path="/demande_proforma" element={<Envoye_demande />}></Route>
          <Route path="/email_interface" element={<EmailInterface />}></Route>

          {/* FOURNISSEUR RELATED URL */}
          <Route path="/home" element={<Accueil />} ></Route>
          <Route path="/pfBcmd" element={<ProformatHavingBcmd />}></Route>
          <Route path="/pfBcmd/:idProformat" element={<ProformatDetailsBcmd />}></Route>
          <Route path="/pfBl" element={<PFBonLivraison />}></Route>
          <Route path="/pfBl/:idProformat" element={<PFDBonLivraison />}></Route>
          <Route path="/facture/:idProformat" element={<Facture />}></Route>
          <Route path="/Hstock" element={<HistoriqueStock />}></Route>
          <Route path="/pfToFacture" element={<PfToFacture />} ></Route>

          <Route path="/vente" element={<Vente />}></Route>
          <Route path="/createProform" element={<CreateProform />}></Route>
          {/* PLAYFIELD RELATED ROUTES */}
          {/* <Route path="/checkBox" element={<CheckBoxes />} /> */}
          <Route path="/validationReception" element={<BonReception />}></Route>
          <Route path="/analyseachat" element={<Analyse />}></Route>
          <Route path="/proformasF" element={<AllProformas />}></Route>
          <Route path="/bdcfournisseur/:idproforma" element={<BonCommandeFournisseur />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
